import React, { useState } from "react";
import "../../css/main.css";

// Importe todos os componentes que você precisa
import AgendaMedica from "../../components/AgendaMedica";
import AgendaOnline from "../../components/AgendaOnline";
import ListaPacientes from "../../components/ListaPacientes";
import GerenPacientes from "../../components/GerenPacientes";
import ProntuarioElect from "../../components/ProntuarioElect";
import GerenClinic from "../../components/GerenClinic";
import Graficos from "../../components/Graficos";
import Financeiro from "../../components/Financeiro";

const Dashboard: React.FC = () => {
  const [selectedMenuItem, setSelectedMenuItem] = useState(""); // Estado para rastrear o item do menu selecionado

  // Função para renderizar o componente correspondente ao item do menu selecionado
  const renderSelectedComponent = () => {
    switch (selectedMenuItem) {
      case "AgendaMedica":
        return <AgendaMedica />;
      case "AgendaOnline":
        return <AgendaOnline />;
      case "ListaPacientes":
        return <ListaPacientes />;
      case "GerenPacientes":
        return <GerenPacientes />;
      case "ProntuarioElect":
        return <ProntuarioElect />;
      case "GerenClinic":
        return <GerenClinic />;
      case "Graficos":
        return <Graficos />;
      case "Financeiro":
        return <Financeiro />;
      default:
        return null;
    }
  };

  return (
    <div className="dashboard-container">
      <div className="sidebar">
        <img src={Logo} alt="Logo da Clínica" className="logo" />{" "}
        <ul className="menu">
          {/* Defina os itens do menu e atribua a função setSelectedMenuItem para atualizar o estado */}
          <li onClick={() => setSelectedMenuItem("AgendaMedica")}>
            Agenda Médica
          </li>
          <li onClick={() => setSelectedMenuItem("AgendaOnline")}>
            Agenda Online
          </li>
          <li onClick={() => setSelectedMenuItem("ListaPacientes")}>
            Lista de Pacientes
          </li>
          <li onClick={() => setSelectedMenuItem("GerenPacientes")}>
            Gerenciamento de Pacientes
          </li>
          <li onClick={() => setSelectedMenuItem("ProntuarioElect")}>
            Prontuário Eletrônico
          </li>
          <li onClick={() => setSelectedMenuItem("GerenClinic")}>
            Gerenciamento da Clínica
          </li>
          <li onClick={() => setSelectedMenuItem("Graficos")}>Gráficos</li>
          <li onClick={() => setSelectedMenuItem("Financeiro")}>Financeiro</li>
        </ul>
      </div>
      <div className="main-content">
        <h1>Dashboard</h1>
        {renderSelectedComponent()}{" "}
        {/* Renderize o componente selecionado aqui */}
      </div>
    </div>
  );
};

export default Dashboard;
